    [],nt"revision_timestamp": "2016-05-31T01:08:53.574193",nt"name": "afsc-abl-coldwater-coral-growth",nt"isopen":
    false,nt"url": null,nt"notes": "Colonies of the gorgonian coral Calcigorgia
    spiculifera were tagged at three sites in Southeast Alaska, Little Port Walter,
    Tenakee Inlet, and Kelp Bay. The corals were videoed in situ. Growth of individual
    coral branches was determined from video observations. Average annual branch growth
    was greatest at Kelp Bay (8.8 mm) and lowest at Tenakee Inlet (3.0 mm). Branch growth
    was positively correlated with colony size.",nt"license_title": null,nt"extras":
